import React from "react";


function App() {
    const title = 'Blog Post';
    const body = 'This is my blog post';
    const comments = [
        {id: 1, text: 'comment one'},
        {id: 2, text: 'comment two'},
        {id: 3, text: 'comment three'},
    ]

    return (
        <div class='container'>
            <h1>{title}</h1>
            <p>{body}</p>

            <div class='comments'>
                <h3>Comments ({comments.length})</h3>
                <ul>
                    {comments.map( (comment, index) => (
                        <li>{comment.text}</li>
                    ))}
                </ul>
            </div>
        </div>
    )
}

export default App
